#include <vector>
#include <string>
#include <iostream>
#include "../minimap2/minimap_interface.hpp"
#include "gtest/gtest.h"
#include "../alignment/aligner.hpp"

TEST(MinimapTests, Time) {
//    std::vector<char*> params = {"minimap2-lite", "test/q-inv.fa", "test/q-inv.fa"};
    timespec start{}, finish{};
    double worktime;
    std::vector<Contig *> reads = {new Contig("", "read1"),
                                          new Contig("", "read2")};
    std::string s = ""
                    "";
    s = reads[0]->str() + s;
    std::vector<Contig *> ref = {new Contig(s, "ref")};
    {
//        std::vector<string> ref1 = {"AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAa", ref[0]->str(), ref[0]->rc().str()};
//        std::vector<string> reads1 = {reads[0]->str(), reads[0]->rc().str()};
//        std::vector<mm_idx_t *> index1 = constructIndex(ref1, 8);
//        std::vector<RawAlignment> tmp = run_minimap(reads1.data(), reads1.data() + reads1.size(), index1);
//        std::cout << tmp.size() << std::endl;
//        exit(0);
        Aligner aligner1;
        AlignmentIndex<Contig> index = aligner1.prepareIndex(ref);
        auto als = aligner1.alignAndTranslate(reads, index);
        std::cout << als.size() << std::endl;
        for(auto & al: als) {
            std::cout << al.view().first << std::endl;
            std::cout << al.view().second << std::endl;
        }
    }
    {
        clock_gettime(CLOCK_MONOTONIC, &start);
        for (size_t i = 0; i < 125; i++) {
            Aligner aligner;
            AlignmentIndex<Contig> index = aligner.prepareIndex(ref, 1);
            aligner.alignAndTranslate(reads, index);
        }
        clock_gettime(CLOCK_MONOTONIC, &finish);
        worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
        std::cout << "Index reloaded " << worktime << std::endl;
        ASSERT_TRUE(worktime <= 8);
    }
    {
        clock_gettime(CLOCK_MONOTONIC, &start);
        Aligner aligner1;
        AlignmentIndex<Contig> index = aligner1.prepareIndex(ref);
        for (size_t i = 0; i < 125; i++) {
            aligner1.alignAndTranslate(reads, index);
        }
        clock_gettime(CLOCK_MONOTONIC, &finish);
        worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
        std::cout << "Default " << worktime << std::endl;
        ASSERT_TRUE(worktime <= 8);
    }
    {
        std::vector<Contig *> many_reads;
        for (size_t i = 0; i < 1000; i++) {
            many_reads.push_back(reads[0]);
            many_reads.push_back(reads[1]);
        }
        clock_gettime(CLOCK_MONOTONIC, &start);
        Aligner aligner2(8);
        AlignmentIndex<Contig> index = aligner2.prepareIndex(ref);
        aligner2.alignAndTranslate(many_reads, index);
        clock_gettime(CLOCK_MONOTONIC, &finish);
        worktime = double(finish.tv_sec - start.tv_sec) + double(finish.tv_nsec - start.tv_nsec) / 1000000000.0;
        std::cout << "8 threads " << worktime << std::endl;
        ASSERT_TRUE(worktime <= 8);
    }
    for(Contig *seq: reads)
        free(seq);
    for(Contig *seq: ref)
        free(seq);
}